import React from "react";
import "./Subtotal.css";
import CurrencyFormat from "react-currency-format";

function Subtotal() {
  return (
    <div className="Subtotal">
      <CurrencyFormat />
      <button></button>
    </div>
  );
}

export default Subtotal;
